import React from "react";
import { MDBCol, MDBIcon } from "mdbreact";
import 'font-awesome/css/font-awesome.min.css';
const SearchBar = () => {
  return (
    <div style={{display:"flex", justifyContent:"center", alignItems:"center", width:"900px"}}>
        <MDBCol md="10" style={{width:"600px", height:"50px"}}>
            <form className="form-inline mt-4 mb-4" style={{width:"600px", height:"50px" ,display:"flex"}}>
                {/* <MDBIcon icon="search" className="text-black" size="lg"/> */}
                <input style={{width:"600px", height:"50px"}} className="form-control form-control-lg " type="text" placeholder="Search" aria-label="Search" />
            </form>

          <div className="input-group md-form form-sm form-1 pl-0">
            <div className="input-group-prepend">
              <span className="input-group-text purple lighten-3" id="basic-text1">
                <MDBIcon className="text-white" icon="search" />
              </span>
            </div>
          </div>

        </MDBCol>
    </div>
  );
}

export default SearchBar;
